DROP TABLE IF EXISTS draft;
CREATE TABLE draft(
   draftYear      INTEGER  NOT NULL 
  ,draftRound     INTEGER  NOT NULL
  ,draftSelection INTEGER  NOT NULL
  ,draftOverall   INTEGER  NOT NULL
  ,tmID           VARCHAR(3) NOT NULL
  ,firstName      VARCHAR(13) NOT NULL
  ,lastName       VARCHAR(15) NOT NULL
  ,suffixName     VARCHAR(3)
  ,playerID       VARCHAR(9)
  ,draftFrom      VARCHAR(43) NOT NULL
  ,lgID           VARCHAR(3) NOT NULL
  ,PRIMARY KEY(firstName,lastName, tmID, draftFrom, draftYear)
);
